  diffuseTransmissionIBL = volumeAttenuation(attenuationColor, attenuationDistance, diffuseTransmissionIBL, diffuseTransmissionThickness);
#endif
  diffuse = mix(diffuse, diffuseTransmissionIBL, diffuseTransmission);
#endif

